def newman_prime(n):
    def is_prime(num):
        if num <= 1:
            return False
        if num <= 3:
            return True
        if num % 2 == 0 or num % 3 == 0:
            return False
        i = 5
        while i * i <= num:
            if num % i == 0 or num % (i + 2) == 0:
                return False
            i += 6
        return True

    def generate_newman_primes():
        yield 2
        s0, s1 = 1, 1
        while True:
            s2 = (s0 + s1) // s1
            s0, s1 = s1, s2
            if is_prime(s2):
                yield s2

    gen = generate_newman_primes()
    for _ in range(n):
        nth_prime = next(gen)
    return nth_prime

