def count_binary_seq(n):
    def count_ways(n, diff):
        if n == 0:
            return 1 if diff == 0 else 0
        if diff < -n or diff > n:
            return 0
        if (n, diff) in memo:
            return memo[(n, diff)]
        ways = count_ways(n - 1, diff - 1) + count_ways(n - 1, diff + 1)
        memo[(n, diff)] = ways
        return ways

