def find_length(binary_string):
    max_diff = 0
    count = 0
    count_dict = {0: 0}

    for char in binary_string:
        if char == '0':
            count += 1
        else:
            count -= 1

        if count in count_dict:
            count_dict[count] += 1
        else:
            count_dict[count] = 1

        if count - min(count_dict.keys()) > max_diff:
            max_diff = count - min(count_dict.keys())

    return max_diff

def find_length(s: str) -> int:
    max_len = 0
    count = 0
    count_dict = {0: -1}

    for i in range(len(s)):
        if s[i] == '0':
            count -= 1
        else:
            count += 1

        if count in count_dict:
            max_len = max(max_len, i - count_dict[count])
        else:
