def pancake_sort(arr):
    def flip(arr, i):
        start, end = 0, i
        while start < end:
            arr[start], arr[end] = arr[end], arr[start]
            start += 1
            end -= 1

    n = len(arr)
    for size in range(n, 1, -1):
        max_index = arr.index(max(arr[:size]))
        flip(arr, max_index)
        flip(arr, size - 1)
    return arr

