def get_pairs_count(nums, target_sum):
    count = 0
    seen = {}
    for num in nums:
        complement = target_sum - num
        if complement in seen:
            count += seen[complement]
        if num in seen:
            seen[num] += 1
        else:
            seen[num] = 1
    return count

